import Vue from 'vue'
import Vuex from 'vuex'
import './plugins/vuetify'
import App from './App.vue'
import store from './store'

Vue.config.productionTip = false


new Vue({
  el: App,
  data: {
    message: 'Привет, Vue!'
  }
})
new Vue({
  store,
  render: h => h(App)
}).$mount('#app')
